import execjs


def js_from_file(file_name):
    with open(file_name, encoding="utf-8", mode="r") as file:
        result = file.read()
    return result


if __name__ == "__main__":

    e = ''

    js_env = execjs.get()

    js_func = 's('"{}"')'.format(e)

    execjs_compile = js_env.compile(js_from_file("./TestJs.js"))
    compile_eval = execjs_compile.eval(js_func)
    # call = execjs_compile.call("s", e)
    print(compile_eval)
